Proc.src:
CREATE OR REPLACE FUNCTION dato_usuario_actualizar_fecha() 
  RETURNS trigger AS 
$$
    BEGIN
        IF ( TG_OP = 'UPDATE' ) THEN
            NEW.dus_updated_at := now();
            RETURN NEW;
        END IF;
    END;
$$
  LANGUAGE plpgsql VOLATILE 
  COST 100;

